<?phpnamespace Nemundo\Admin\Web;use Nemundo\Admin\AdminConfig;use Nemundo\Admin\Controller\AdminController;use Nemundo\Admin\Page\AdminNotFoundPage;use Nemundo\Web\Base\AbstractWeb;use Nemundo\Web\WebConfig;class AdminWeb extends AbstractWeb{    public function loadWeb()    {        WebConfig::$notFoundPageClass = AdminNotFoundPage::class;        AdminConfig::$documentTitle = 'Admin';        AdminConfig::$webController = new AdminController();        AdminConfig::$userMode = true;        AdminConfig::$webController->render();    }}